import React, { Component } from 'react'
import Navibar from "../Coponent/Navibar";
import Axios from 'axios';


export default class Property extends Component {
    constructor(props) {
        super(props)
        this.state = {
            response:[]
        }


    }
    getData(){
        console.log(this.props.user.sid)
        var url="http://127.0.0.1:8081/v2/room/supplier?sid="
        url+=this.props.user.sid
        console.log(url)
        Axios.get(url)
            .then(res=>{
                console.log("res:",res.data);
                this.setState({
                    response:res.data
                })


            });   
    }
    handle_cancel(rid){
        console.log(rid)
        let url="http://127.0.0.1:8081/v2/room/cancel";
        fetch(url,{
            method: 'post',
            headers:{
                'content-type':'application/json',
                'accept':'application/xml'
            },
            body: JSON.stringify(rid)
        }).then((result) => {
            result.json().then((resp)=>{
                console.log(resp)
                if(resp==="Your room has been removed"){
                    alert("Your room has been removed")
                    this.props.history.push('./property')  
                }
            })
        })
    }





    render() {
        console.log(this.props.user.sid)

        return (
            <div className = "property">
                <Navibar loggedinstatus={this.props.loggedinstatus} />  
                <div className="property-container">
                    <button className="proper_button" onClick={()=> {this.getData()}}>Manage your property</button>
                    <br />
                    <div >
                        {this.state.response.map((detail,index) => {
                            return <div className="s_div">
                                <div>
                                    <h3>Room </h3>
                                    <p className="di">{index}</p>
                                </div>
                                <div>
                                    <h3>Room name: </h3>
                                    <p className="di">{detail.name}</p>
                                </div>
                                <div>
                                    <h3>Room price: </h3>
                                    <p className="di">{detail.price}</p>
                                </div>
                                <div>
                                    <h3>Room capacity: </h3>
                                    <p className="di">{detail.capacity}</p>
                                </div>
                                <div>
                                    <h3>Booking status: </h3>
                                    <p className="di">0</p>
                                </div>
                                <br />
                                <h3>rid: {detail.rid}</h3>
                                <button className="cancel_button" onClick={()=>this.handle_cancel(detail.rid)}>
                                    cancel property
                                </button>
                            </div>
                        })}
                    </div>


                </div>
            </div>      
        )
    }
}
